#include "BigInteger.h"#include <random>#include <iostream>vector<unsigned long int> createRandomNumber();int main() {    BigInteger a = BigInteger(createRandomNumber());    a.printNumber();    BigInteger b = BigInteger(createRandomNumber());    b.printNumber();    BigInteger c = a - b;    c.printNumber();}vector<unsigned long int> createRandomNumber() {    vector<unsigned long int> output;    std::random_device rd;    std::mt19937 generator(rd());    std::uniform_int_distribution<long long int> distribution(0, 0xFFFFFFFF);    output.reserve(8);    for (int i = 0; i < 8; ++i) {        output.push_back(distribution(generator));    }    return output;}